sys_variable_value.value:
(function execute(inputs, outputs) {
  try {

    var inputs = SapRFCUtil.EscapeHTMLInjection(inputs);

    //Validate mandatory fields
    var mandatoryFieldsList = {
      "Company Code": inputs.compcode,
      "General Data > Asset class": inputs.generaldata.ASSETCLASS
    };

    var emptyFields = SapRFCUtil.checkMandatoryFields(mandatoryFieldsList);
    if (JSUtil.notNil(emptyFields)) {
      throw  'Mandatory field(s) '.concat(emptyFields)+' cannot be blank.';
    }

    var info = SapRFCUtil.getConnectionFromAlias(inputs.alias_id);
    outputs.conn_host = info.getAttribute("host");
    outputs.conn_params = info.getExtendedAttributes();

    var connId = info.getAttribute("sys_id");
    outputs.cred_id = SapRFCUtil.getCredentialIdFromConnection(connId);

    if (inputs.generaldata != null) {
      inputs['generaldatax'] = new Object();
      for (genKey in inputs.generaldata) {
        if (inputs.generaldata[genKey] != null && inputs.generaldata[genKey] !== '') {
          inputs.generaldatax[genKey] = 'X';
        }
      }
    }

    if (inputs.DepreciationAreas != null && !JSUtil.isEmpty(inputs.DepreciationAreas)) {
      inputs['DEPRECIATIONAREASX'] = new Array();
      for (var i = 0; i < inputs.DepreciationAreas.length; i++) {
        var depAreaX = new Object();
        var depArea = inputs.DepreciationAreas[i];
        for (depAreaKey in depArea) {
          var hasVal = depArea[depAreaKey] != null && depArea[depAreaKey] !== '';
          if (hasVal && depAreaKey !== 'AREA') {
            depAreaX[depAreaKey] = 'X';
          } else if (hasVal) {
            depAreaX[depAreaKey] = depArea.AREA;
          }
        }
        if (Object.keys(depAreaX).length !== 0) {
          inputs.DEPRECIATIONAREASX.push(depAreaX);
        }
      }
    }

    var payload = SapRFCUtil.unflattenPayload(inputs.additional_in);
    payload['COMPANYCODE'] = inputs.compcode;
    payload['REFERENCE'] = inputs.reference;
    payload['GENERALDATA'] = inputs.generaldata;
    payload['GENERALDATAX'] = inputs.generaldatax;
    payload['DEPRECIATIONAREAS'] = inputs.DepreciationAreas;
    payload['DEPRECIATIONAREASX'] = inputs.DEPRECIATIONAREASX;

    outputs.json_in = SapRFCUtil.removeMetaNameField(payload);
  } catch (e) {
    throw e;
  }
})(inputs, outputs);

